import React from "react";
import PropTypes from "prop-types";

export default function CardProfilePatient({ patient }) {
  return (
    <div className="bg-white shadow-md rounded-lg px-8 pt-6 pb-8 mb-4">
      <div className="mb-4">
        <h2 className="text-xl font-bold mb-2">{`${patient.nom} ${patient.prenom}`}</h2>
        <p className="text-gray-600 text-sm">{patient.cin}</p>
        <p className="text-gray-600 text-sm">{patient.date_de_naissance}</p>
      </div>
      <div className="flex justify-end">
        <button
          className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
          type="button"
        >
          Edit Profile
        </button>
      </div>
    </div>
  );
}

CardProfilePatient.propTypes = {
  patient: PropTypes.shape({
    nom: PropTypes.string.isRequired,
    prenom: PropTypes.string.isRequired,
    cin: PropTypes.string.isRequired,
    date_de_naissance: PropTypes.string.isRequired,
  }).isRequired,
};
